9) prima di dare inizio agli scavi ed ai lavori di costruzione dovrà es- sere chiesta agli Enti esercenti pubblici servizi (Enel, Sip-Telve, Azienda Gas, Azienda Acquedotto, ecc.) ogni notizia per sapere se det ti Enti possiedono sulle strade o sulle aree interessate dai lavori: cavi elettrici o telefonici aerei o sotterranei e tubazioni per tra- sporto gas, acqua, ecc .;
10) in conformità a quanto stabilito dall'art. 4 del vigente regolamento edilizio, i lavori dovranno avere inizio entro un anno dalla data del rilascio della presente concessione, pena la decadenza dello stesso. Il termine di ultimazione entro il quale l'opera deve essere resa abi- tabile o agibile è di anni 3 a decorrere dalla presente concessione;
11) prima di dare inizio ai lavori di costruzione dovrà venire richiesta per iscritto, a cura del concessionario e del costruttore, la determi- nazione dei punti fissi di linea e di livello del fabbricato e dovrà venire tempestivamente data comunicazione del giorno di inizio degli stessi ;
12) il rilascio della concessione non vincola il Comune in ordine a lavori che il Comune stesso intendesse eseguire per migliorare i propri ser- vizi (viabilità, illuminazione, fognature, impianto idrico, ecc.) in conseguenza dei quali non potranno essere pretesi compensi o indenni- tà salvo quanto previsto da leggi e regolamenti;
13) prima dell'inizio dei lavori dovrà essere collocata, all'esterno del cantiere, ben visibile al pubblico, una tabella con le seguenti indi- cazioni: Ditta proprietaria - Progettista - Direttore dei lavori - E- stremi della presente concessione.
14) E' fatto obbligo al Concessionario di depositare presso il competente Ufficio Comunale, prima della dichiarazione di inizio lavori, la do- cumentazione relativa;
1) Progetto dell'impianto termico giusto art. 9 Legge 30.4.1976 nº 373 e relativo regolamento art. 19 D.P.R. 28.6.1977 nº 1052;
2) Domanda di concessione di attacco degli scarichi di fognatura a norma dell'art. 17 del vigente disciplinare per le immissioni nella fognatura cittadina (Delibera Consiliare nº 24-302 del 4.4.1977).
15) Visto il D.M. 14.5.1982, che ha dichiarato il territorio comunale si- smico, ai se si e per gli effetti della Legge 2.2.1974, nº 64, con grado di sismicità 9=9, è fatto obbligo al concessionario di osserva- re le prescrizioni tutte contenute nella legge anzi detta.
A CONDIZIONE che la concimaia venga opportunamente mascherata con alberatura della zona (sempreverdi ed a foglia caduca).
